webpackJsonp([492],{1465:function(module,exports){module.exports="import React from 'react';\nimport {bool, node} from 'prop-types';\nimport classNames from 'classnames';\nimport styles from './Header.scss';\nimport WixComponent from '../../BaseComponents/WixComponent';\n\nclass Header extends WixComponent {\n\n  static propTypes = {\n    title: node.isRequired,\n    subtitle: node,\n    withoutDivider: bool,\n    suffix: node\n  };\n\n  static defaultProps = {\n    subtitle: null,\n    suffix: null,\n    withoutDivider: false\n  };\n\n  render() {\n    const {title, subtitle, withoutDivider, suffix} = this.props;\n\n    const headerClasses = classNames({\n      [styles.header]: true,\n      [styles.withDivider]: !withoutDivider\n    });\n\n    const titleElement = (\n      <div data-hook=\"title\" className={styles.title}>\n        {title}\n      </div>\n    );\n\n    const subtitleElement = subtitle ? (\n      <div data-hook=\"subtitle\" className={styles.subtitle}>\n        {subtitle}\n      </div>\n    ) : null;\n\n    const suffixElement = suffix ? (\n      <div data-hook=\"suffix\">\n        {suffix}\n      </div>\n    ) : null;\n\n    return (\n      <div className={headerClasses}>\n        <div className={styles.container}>\n          {titleElement}\n          {subtitleElement}\n        </div>\n        {suffixElement}\n      </div>\n    );\n  }\n}\n\nexport default Header;\n"}});